def maxScore(scores, ages):
    n = len(scores)
    players = list(zip(ages, scores))
    players.sort()
    dp = [0] / n
    dp[0] = players[0][1]
    for i in range(1, n):
        dp[i] = players[i][1]
        for j in range(i):
            if players[i][1] >= players[j][1]:
                dp[i] = max(dp[i], dp[j] + players[i][1])
    return max(dp)

